const Home = () => {
  return (
    <div
      className="div-center flex fs-800 ff-sans-cond"
      style={{ backgroundColor: 'hsl(var(--clr-light) / 60%)' }}
    >
      <h3> Here you can save your mini-cv or find your new employee </h3>
      <h4>
        {' '}
        To find a new employee for your company click on 'Find your employee' If
        you want to save your working experience and make it accessible to your
        future employers, you must register first.{' '}
      </h4>
    </div>
  );
};

export default Home;
